INSERT INTO `admin_text_settings` (`id`, `name`, `message`, `add_at`, `access`) VALUES
(1, 'SITE_CGU', '&lt;div class=&quot;row&quot;&gt;&lt;h2 class=&quot;bold&quot;&gt;Registration&lt;/h2&gt;Registration is completely free. it allows to promote ours websites.The site include a viewer sites automated allow members of surfing, of exchange web pages and win free credits. Your registration to our program is considered a acceptance final the terms and conditions of the program. Your subscribe to newsletter is on automatically your registration! The only way to no longer receive our emails will be unsubscribe from our site! During registration member must provide information accurate and complete on his identity.Any false identity and, or fraudulent acts will result in an account termination without notice! Members can not have that a single account. Any fraud attempt will be punished immediately! Self sponsorship strictly prohibited. An account per person physical and computer!.\r\nYou have the opportunity to make the promotion of our site, but we do not tolerate any form of spam (shipments mass mails unsolicited) which is strictly prohibited. Offender see his deleted account. If the member precludes to any of terms and conditions of this agreement, or any what following changes to this agreement, or becomes dissatisfied program, the only use of the member will stop immediately its participation in the program and cancel membership accepting subscribing on our site, you agree not to keep rigor thereto to some a result whatsoever as to the use of our services, and we will be held responsible for events technical or beyond our control. Our site may be temporarily outage and on behalf of the member becomes inaccessible temporarily. Our intention is to provide our services in the best possible conditions and sustain life site. If you have a problem any with our services, please contact, first of all, directly to our support by using the contact form of the site. By registering as member, you agree to comply with the terms and conditions defined in these terms and conditions.Your account will be deleted after 180 days of inactivity, unless you we notify!.&lt;/div&gt;\r\n&lt;div class=&quot;col-sm-12&quot;&gt;&lt;h2 class=&quot;bold&quot;&gt;sites accepted: &lt;/h2&gt;- blogs with maximum a pop-up.\r\n- sites normal with no pop-up,\r\n- sites normal with a pop-up, \r\n\r\n&lt;h2 class=&quot;bold&quot;&gt; sites refused:&lt;/h2&gt;- sites showing pages randomly, (called commonly rotator).\r\n- site with a redirect making leave autosurf,\r\n- site with a / several alert (s) JavaScript, - sites with more than one pop-up,\r\n- sites pornographic nature injuring! (pedophile, zoophile, are strictly prohibited),\r\n- sites with sexual practice minority (gay, lesbian, fetish, HM, ...),\r\n- sites illegal (warez, hacking, p2p etc),\r\n- sites discriminatory, racist,\r\n- sites hosted by multimania / Lycos (too advertisements &amp; leaves autosurf),\r\n- sites containers too many errors (MySQL, PHP etc ...),\r\n- sites containers too many banners and links promotional.\r\n- links promotional direct (cibleclick, wipub etc ...).The following sites will not be allowed, will be deleted and banned site without notice.\r\n&lt;/div&gt;\r\n\r\n&lt;div class=&quot;row&quot;&gt;\r\nIf you do follow not what has been discussed above, your account will be suspended. Please provide us prevent, if a site does not comply with these conditions! . If you see a location that is not not consistent with our rules (content injuring, or interfere with your surf), click &quot;report abuse&quot; .\r\nto US notify. we can go up to suspend the location. we Reserve the right to determine what sites are not allowed. Once credits purchased through allopass / PayPal they can not be taken, exchanged or refunded. if a point is not not included, please contact us for more information!\r\n&lt;/div&gt;\r\n', 1479591582, 1),
(13, 'SITE_FOOTER_BLOG_L', '&lt;h2 class=&quot;underline&quot;&gt; about US &lt;/h2&gt;We offer you the opportunity to know your websites to thousands of users and all this in shortly. we are available 24/24, 7/7. with our site, see your sites in great. Exchange visits on other sites by visits your web sites. you can also see your links or banners on our sites for visits more targeted. subscribe a lot of surprises are waiting for you. for more information please contact US. we will the pleasure of you answer in the shortest possible.', 1479587867, 1),
(2, 'SITE_TITLE', '&nbsp; PROPUB v0.15.501++', 1479232801, 1),
(3, 'SITE_DESCRIPTION', 'description de l''htel', 1476179525, 1),
(4, 'SITE_KEYWORDS', 'surf, autosurf, web, promotion, public, publicit&eacute;, ads, addons', 1479232810, 1),
(5, 'SITE_AUTHOR', 'tor skint', 1476049803, 1),
(6, 'CONTACT_EMAIL', 'tor.skint@gmail.com', 1479233107, 1),
(7, 'SITE_ADRESS', '&lt;strong&gt;Twitter, Inc.&lt;/strong&gt;&lt;br&gt;   795 Folsom Ave, Suite 600&lt;br&gt;   San Francisco, CA 94107&lt;br&gt;   &lt;abbr title=&quot;Phone&quot;&gt;P:&lt;/abbr&gt; (123) 456-7890', 1479232785, 1),
(8, 'SITE_BRAND', 'PROPUB v0.15.501++', 1479232793, 1),
(11, 'FREE_OFFERS', '&lt;li&gt;&lt;strong&gt; Surf bar &lt;/strong&gt; / 0.5 point. &lt;/li&gt; &lt;li&gt;&lt;strong&gt; Referer &lt;/strong&gt; / 10 points. &lt;/li&gt; &lt;li&gt;&lt;strong&gt; Day bonus &lt;/strong&gt; / 1-100 points. &lt;/li&gt; &lt;li&gt;&lt;strong&gt; Blacklist &lt;/strong&gt; / 5 sites. &lt;/li&gt; &lt;li&gt;&lt;strong&gt; Sites &lt;/strong&gt; / 2 sites. &lt;/li&gt; &lt;li&gt;&lt;strong&gt; Expiration &lt;/strong&gt; / never. &lt;/li&gt; &lt;li&gt;&lt;strong&gt; Price &lt;/strong&gt; / 0.000 points. &lt;/li&gt; ', 1479232475, 0),
(10, 'SITE_ADDONS_BLOCK', '&lt;!--div class=&quot;col-sm-push-1 col-sm-3 visible-sm&quot; style=&quot;display:none;&quot;&gt;         &lt;br/&gt; &lt;br/&gt;          &lt;p class=&quot;col-sm-12&quot;&gt;         &lt;img src=&quot;views/templates/assets/img/1.png&quot;/&gt;         &lt;/p&gt;                  &lt;p class=&quot;col-sm-12&quot;&gt;         &lt;img src=&quot;views/templates/assets/img/5.jpg&quot;/&gt;         &lt;/p&gt;                  &lt;/div--&gt;', 1479232830, 1),
(9, 'SITE_ROOT', 'http://127.0.0.1:8080/', 1476049623, 1),
